import React from "react";
import AppCarousel from "./AppCarousel";
import "./Home.css";

function Home() {
  return (
    <div className="home-container">
      <AppCarousel />
      <h1 className="home-title">Welcome to my website!</h1>
    </div>
  );
}

export default Home;
